import React, { Component } from "react";
// import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";
import GoogleMapReact from 'google-map-react';
// import CreateTodo from "./components/create-todo.component";
// import EditTodo from "./components/edit-todo.component";
// import TodosList from "./components/todos-list.component";

const AnyReactComponent = ({ text }) => <div>{text}</div>;

class App extends Component {

	static defaultProps = {
	    center: {
	      lat: 59.95,
	      lng: 30.33
	    },
	    zoom: 11
	};

	constructor(props) {

		super(props);

		// initial states
		this.state = {

			num_loteos: 5,
			num_pieces_ground: 39,

		}

	}


	// render method
	render() {

		return (
		  // <Router>
		    <div className="container">

				<nav className="navbar navbar-expand-lg navbar-light bg-light">

					<p to="/" className="navbar-brand"> 

						MERN-Stack Todo App

					</p>

					<div className="collpase navbar-collapse">

						<ul className="navbar-nav mr-auto">

							<li className="navbar-item">

								<p to="/" className="nav-link">Todos</p>

							</li>

							<li className="navbar-item">

								<p to="/create" className="nav-link">Create Todo</p>

							</li>

						</ul>

					</div>

				</nav>

		    <div>

		    	<h2>

		    		Nuestros proyectos de parcelas

		    	</h2>

		    	<div>

		    		{this.state.num_loteos} loteos - {this.state.num_pieces_ground} parcelas disponibles - Todas con facilidades de pago

		    	</div>

		    </div>

		  	<div>

				<div style={{ height: '100vh', width: '100%' }}>

					<GoogleMapReact
						bootstrapURLKeys={{ key: 'AIzaSyCBQbWeOGDoSi2ixWkcJQu7A8FJtfmA2p8' }}
						defaultCenter={this.props.center}
						defaultZoom={this.props.zoom}
					>
						<AnyReactComponent
						lat={59.955413}
						lng={30.337844}
						text="My Marker"
						/>

					</GoogleMapReact>

				</div>

		  	</div>


		    </div>
		  // </Router>
		);

	}

}

export default App;
